  \"archive-of-geosample-data-and-information-from-the-oregon-state-university-osu-college-of-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Oregon State University Marine Geology
  Repository (OSU-MGR) is located in the College of Earth, Ocean and Atmospheric Sciences
  (CEOAS).  The OSU-MGR is a National Science Foundation (NSF) supported curation
  facility for marine rock and sediment samples.  The OSU-MGR contains over 41,000
  cubic feet of refrigerated space and 1,100 cubic feet of -25 degrees C cold storage
  and is well equipped for preservation and distribution of marine geological samples
  for scientific research and education. The OSU-MGR is a partner in the Index to
  Marine and Lacustrine Geological Samples (IMLGS) database. As a partner repository,
  OSU sends data and information related to the OSU sample collection to NCEI for
  long-term archive, and for discoverability via the IMLGS.\",\n\t\"license_title\":
